script: |
  super -f text -I q10844.spq | sort > q10844.out

inputs:
  - name: q10844.spq
    data: |
      SELECT ALL col0 AS col1 FROM tab1 (FORMAT parquet) WHERE - col1 + - col1 * - col2 NOT IN ( + col1 * col2 );
  - name: tab1

outputs:
  - name: q10844.out
    data: |
      3
      64
      80
